import React from "react";
import "./style.css";
import { useHistory } from 'react-router-dom';


function Header() {
  let history = useHistory();
    return <div>
        <div className="head">나의 투두리스트</div>
        <button
            className='btn btn-danger'
            onClick={() => {
                history.goBack();
            }}>뒤로가기</button>

    </div>

}

export default Header;
